import React, {Component} from "react";
import axios from "axios";
/* eslint-disable */

class Results extends Component {
    constructor(props) {
		super(props)
		this.state = {
			result: ''
		}
	}

	
	componentDidUpdate() {
		console.log(encodeURI("http://127.0.0.1:8000/api/subs/?format=json&subname="
		.concat((this.props.ingredient).toString())))
		this.props.showResult ? () => {
			axios.get(encodeURI("http://127.0.0.1:8000/api/subs/?format=json&subname="
		.concat((this.props.ingredient).toString())
			)).then( 
        response => { 
            var result = response.data; 
            this.setState({ result: result })
            }, 
            (error) => { 
            {alert(error)}; 
            } 
		)
		} : null
	}

	render() {
		return(
            <div>
                    {this.state.result} 
					 
            </div>
        )
    }
}

export default Results
